  true,\n\t\"url\": null,\n\t\"notes\": \"We propose the development of a CTE-matched,
  liquid-cooled, high thermal conductivity heat sink for use in spacecraft thermal
  management applications.  The material of construction of this heat sink has four
  properties that are critical: high normal and specific thermal conductivities, low
  CTE, high temperature resistivity, and moldability.  Its thermal conductivities
  are higher than that of copper, so the thermal resistance across this heat sink
  will be lower than one made of copper.  At the same time, it has a low CTE, which
  is slightly less than silicon and close to the CTE?s of most semiconductor and optical
  materials.  CTE-matching is critical in space applications because of the wide variations
  in ambient temperatures, which can lead to delamination of heat sinks from electronics
  or their fracture.  This material can withstand very high temperatures, so a faster
  CVD diamond deposition process is feasible.  The diamond layer maximizes the thermal
  spreading at the heat sink-device interface (important for devices that are sensitive
  to temperature gradients) and also provides electrical isolation of the electrical
  components being cooled.  Finally, the material is moldable, so heat sinks with
  complex external geometries, e.g. curved for optics, and internal surfaces can be
  fabricated inexpensively.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
